class MemSuite:
    def mem_ppl_arrow(self):
        return self.arrays_pipeline.arrow_arrays()

    def setup(self):
        dim_x = np.arange(0, 1000000).tolist()
        dim_y = np.arange(1000000, 2000000).tolist()
        dim_z = np.arange(2000000, 3000000).tolist()
        self.arrays = np.array(
            [(x, y, z) for x, y, z in zip(dim_x, dim_y, dim_z)],
            dtype=[("X", np.float), ("Y", np.float), ("Z", np.float)]
        )

        self.ppl_rd_las_json ="""
        {
            "pipeline": [
                {
                    "type": "readers.las",
                    "filename": "test/data/1.2-with-color.las"
                }
            ]
        }
        """

        self.ppl_fltr_arrays_json="""
        {
            "pipeline": [
                {
                    "type": "filters.range",
                    "limits": "Z[0:5000000]"
                }
            ]
        }
        """
        self.arrays_pipeline = pdal.Pipeline(self.ppl_fltr_arrays_json, [self.arrays])

